import { useState } from "react";
import Component from "react-dom";
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      counter: 0,
    };
  }
  setCounter() {
    this.counter++;
  }
  render() {
    return (
      <>
        <h1>counter is : </h1>
        <button onClick={this.setCounter}>click</button>
      </>
    );
  }
}
export default App;
